import React from 'react';
import styled from 'styled-components';

const CLogo = styled.div`
  color: white;
  background-color: black;
  width: 100px;
  height: 100px;
`;

function Logo({ children }) {
  return <CLogo><Link to="/">{title}</Link></CLogo>
}

export default Logo;
